import React from 'react';
import { Col, Row } from 'react-bootstrap';

const Note = ({note}) => {
    return (
        <Row key={note.id}>
            <Col md={4}>
                {note.title}
            </Col>
            <Col md={4}>
                {note.title}
            </Col>
            <Col md={4}>
                {note.title}
            </Col>
        </Row>
    );
};

export default Note;
